import React, { Component } from "react";
import axios from "axios";
export class join extends Component {
  componentDidUpdate() {

    // Typical usage (don't forget to compare props):
    const batch = this.props.match.params.id;
    const student = localStorage.getItem("userid");
    const url="http://localhost:8000/api/batch-students/"+batch;
    console.log(url);
    let bodyFormData = new FormData();
    bodyFormData.set("student", student);
    axios
      .post(url, bodyFormData)
      .then((result) => {
        console.log(result.data);

      })
      .catch((error) => {
        console.log(error);

      });

  }
  render() {
    //console.log(this.props);
    return (
      <div>
        <h1>Hello {this.props.match.params.id}</h1>
      </div>
    );
  }
}

export default join;
